import React from 'react';

const Header = () => {
  return (
    <header className="bg-black text-white p-4">
      <nav className="container mx-auto flex justify-between items-center">
        <div className="flex items-center">

          <span className="text-lg font-semibold">Desktop (THE GOOD ONE)</span>
        </div>
        <div className="hidden md:flex space-x-6">
          <a href="#about" className="hover:text-gray-400">About</a>
          <a href="#applications" className="hover:text-gray-400">Applications</a>
          <a href="#sponsors" className="hover:text-gray-400">Sponsors</a>
          <a href="#faq" className="hover:text-gray-400">FAQ</a>
          <a href="#team" className="hover:text-gray-400">The Team</a>
          <a href="#contact" className="hover:text-gray-400">Contact Us</a>
        </div>
      </nav>
    </header>
  );
};

export default Header;
